import React, { Component } from 'react';
import './Bird.scss'
class Bird extends Component {
    render() {
        return (
                <div class="container">
                    <div class="head">
                    <div class="eye left-eye"></div>
                    <div class="eye right-eye"></div>
                    </div>
                    <div class="left-upper-wing">
                    <div class="left-lower-wing"></div>
                    </div>
                    <div class="right-upper-wing">
                    <div class="right-lower-wing"></div>
                    </div>
                </div>
        );
    }
}

export default Bird;
